                        </tr><tr class=""><td class="">Cell</td><td class="">Cell</td><td class="">Cell</td></tr><tr class=""><td class="">Cell</td><td class="">Cell</td><td class="">Cell</td></tr></tbody><tfoot class=""><tr class=""><th colSpan="3" class=""><div class="ui pagination right floated menu"><a class="icon item"><i aria-hidden="true" class="chevron left icon"></i></a><a class="item">1</a><a class="item">2</a><a class="item">3</a><a class="item">4</a><a class="icon item"><i aria-hidden="true" class="chevron right icon"></i></a></div></th></tr></tfoot></table>
